// App.js
import { useEffect, useState } from "react";
import axios from "axios";
import { MapContainer, TileLayer, Marker, Popup } from "react-leaflet";
import "leaflet/dist/leaflet.css";
import { Line } from "react-chartjs-2";
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
} from "chart.js";
import L from "leaflet";

// ✅ Fix for missing Leaflet marker icons
import markerIcon2x from "leaflet/dist/images/marker-icon-2x.png";
import markerIcon from "leaflet/dist/images/marker-icon.png";
import markerShadow from "leaflet/dist/images/marker-shadow.png";

delete L.Icon.Default.prototype._getIconUrl;
L.Icon.Default.mergeOptions({
  iconRetinaUrl: markerIcon2x,
  iconUrl: markerIcon,
  shadowUrl: markerShadow,
});

ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend
);

function App() {
  const [buoys, setBuoys] = useState([]);
  const [selectedBuoy, setSelectedBuoy] = useState(null);
  const [loading, setLoading] = useState(false);

  // 1. Fetch buoy list from backend
  useEffect(() => {
    axios.get("http://localhost:5000/api/buoys").then((res) => {
      if (res.data.success) {
        setBuoys(res.data.buoys);
      }
    });
  }, []);

  // 2. Fetch buoy details by ID/name
  const fetchBuoyDetails = async (id) => {
    setLoading(true);
    try {
      const res = await axios.get(`http://localhost:5000/api/buoy/${id}`);
      if (res.data.success) {
        setSelectedBuoy(res.data.data);
      }
    } catch (err) {
      console.error("Error fetching buoy details", err);
    }
    setLoading(false);
  };

  // Fake tideData (backend doesn’t provide yet)
  const tideData = selectedBuoy
    ? [0.5, 1.2, 0.8, 1.6, 1.1, 0.7] // placeholder until backend has real values
    : [];

  const chartData =
    selectedBuoy && tideData.length > 0
      ? {
          labels: ["00:00", "04:00", "08:00", "12:00", "16:00", "20:00"],
          datasets: [
            {
              label: `Tide levels @ ${selectedBuoy.name}`,
              data: tideData,
              borderColor: "#3b82f6",
              backgroundColor: "rgba(59,130,246,0.2)",
            },
          ],
        }
      : null;

  return (
    <div className="min-h-screen bg-gradient-to-b from-blue-200 to-blue-500 text-gray-900">
      {/* Header */}
      <header className="p-6 text-center bg-yellow-300 text-black font-bold text-3xl shadow-md">
        🌊 Marinex – Live Buoy & Tide Dashboard
      </header>

      {/* Stats */}
      <div className="grid grid-cols-2 md:grid-cols-4 gap-4 p-6">
        <div className="bg-white rounded-xl p-4 text-center shadow-md">
          <h2 className="text-lg">Total Buoys</h2>
          <p className="text-2xl font-bold">{buoys.length}</p>
        </div>
        <div className="bg-white rounded-xl p-4 text-center shadow-md">
          <h2 className="text-lg">Avg Tide</h2>
          <p className="text-2xl font-bold">~1.1m</p>
        </div>
        <div className="bg-white rounded-xl p-4 text-center shadow-md">
          <h2 className="text-lg">Recent Data</h2>
          <p className="text-2xl font-bold">27</p>
        </div>
        <div className="bg-white rounded-xl p-4 text-center shadow-md">
          <h2 className="text-lg">Status</h2>
          <p className="text-2xl font-bold">🟢 Online</p>
        </div>
      </div>

      {/* Main Layout */}
      <div className="grid grid-cols-1 lg:grid-cols-2 gap-6 p-6">
        {/* Map */}
        <div className="bg-white rounded-2xl shadow-lg overflow-hidden">
          <MapContainer
            center={[12.5, 80]}
            zoom={5}
            style={{ height: "500px", width: "100%" }}
          >
            <TileLayer
              attribution='&copy; <a href="http://osm.org/copyright">OpenStreetMap</a>'
              url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
            />
            {buoys.map((b, idx) => (
              <Marker
                key={idx}
                position={[b.lat || 12.5, b.lon || 80]} // backend currently missing lat/lon
                eventHandlers={{
                  click: () => fetchBuoyDetails(b.name),
                }}
              >
                <Popup>{b.name}</Popup>
              </Marker>
            ))}
          </MapContainer>
        </div>

        {/* Details + Chart */}
        <div className="bg-white rounded-2xl shadow-lg p-6 flex flex-col">
          {loading ? (
            <p>Loading buoy details...</p>
          ) : selectedBuoy ? (
            <>
              <h2 className="text-xl font-semibold mb-2">
                {selectedBuoy.name}
              </h2>
              <p className="text-sm text-gray-600 mb-4">
                Lat: {selectedBuoy.lat || "N/A"}, Lon: {selectedBuoy.lon || "N/A"}
              </p>
              <div className="flex-1">
                {chartData ? <Line data={chartData} /> : <p>No tide data yet.</p>}
              </div>
            </>
          ) : (
            <p className="text-gray-500">
              🗺️ Click on a buoy marker to view details.
            </p>
          )}
        </div>
      </div>
    </div>
  );
}

export default App;
